import styled from "styled-components";
import Navbar from "./components/Navbar";
import Main from "./Pages/Main";

const Container = styled.div`
  background-color: #fff;
  width: 80%;
  height: 100vh;
  margin-left: auto;
  margin-right: auto;
`;
function App() {
  return (
    <Container>
      <Navbar />
      <Main />
    </Container>
  );
}

export default App;
